#include <err.h>
#include <stdlib.h>

#include "model.h"

void add_submodel(struct model * to, struct model * from)
{
	int o = to->cardinality;
	unsigned int i;

	size_t s = sizeof(struct polygon)*(to->cardinality+from->cardinality);
	to->poly = realloc(to->poly,s);

	if(to->poly==NULL)
		err(-73,"add_submodel realloc failed");

	for(i=0;i<from->cardinality;i++){
		to->poly[o+i]=from->poly[i];
	}

	to->cardinality+=from->cardinality;
}

